		if ($this->isColumnModified(LeadershipPeer::EXTRA16)) $criteria->add(LeadershipPeer::EXTRA16, $this->extra16);
		if ($this->isColumnModified(LeadershipPeer::EXTRA17)) $criteria->add(LeadershipPeer::EXTRA17, $this->extra17);
		if ($this->isColumnModified(LeadershipPeer::EXTRA18)) $criteria->add(LeadershipPeer::EXTRA18, $this->extra18);
		if ($this->isColumnModified(LeadershipPeer::EXTRA19)) $criteria->add(LeadershipPeer::EXTRA19, $this->extra19);
		if ($this->isColumnModified(LeadershipPeer::EXTRA20)) $criteria->add(LeadershipPeer::EXTRA20, $this->extra20);

		return $criteria;
	}

	/**
	 * Builds a Criteria object containing the primary key for this object.
	 *
	 * Unlike buildCriteria() this method includes the primary key values regardless
	 * of whether or not they have been modified.
	 *
	 * @return     Criteria The Criteria object containing value(s) for primary key(s).
	 */
	public function buildPkeyCriteria()
	{
		$criteria = new Criteria(LeadershipPeer::DATABASE_NAME);

		$criteria->add(LeadershipPeer::ID, $this->id);

		return $criteria;
	}

